angular.module("ngFoundation.templates").run(["$templateCache",function(n){n.put("alert/alert.tpl.html",'<div class="alert-box">\n	<span ng-bind-html="$content"></span>\n  <a href="" class="close" ng-click="$hide()">&times;</a>\n</div>'),n.put("dropdown/dropdown.tpl.html",'<ul class="f-dropdown" ng-class="{ content: content }" tabindex="-1">\n  <li ng-if="!content" ng-repeat="item in items" ng-bind-html="item.content"></li>\n  <p ng-if="content" ng-bind-html="content"></p>\n</ul>'),n.put("modal/modal.tpl.html",'<div class="reveal-modal">\n	<span ng-bind-html="content"></span>\n  <a class="close-reveal-modal" ng-click="$hide()">&#215;</a>\n</div>'),n.put("range-slider/range-slider.tpl.html",'<div class="range-slider">\n  <span class="range-slider-handle" role="slider" tabindex="0"></span>\n  <span class="range-slider-active-segment"></span>\n</div>'),n.put("tabs/tabs.tpl.html",'<div ng-style="{\n  display: \'none\'\n}" ng-transclude></div>\n<dl class="tabs">\n  <dd ng-repeat="tab in tabCtrl.getTabs()" ng-class="{\n    active: tab.active\n  }" ng-click="tabCtrl.setTab(tab.id)">\n    <a href="" ng-bind="tab.title"></a>\n  </dd>\n</dl>\n<div class="tabs-content">\n  <div class="content" ng-repeat="tab in tabCtrl.getTabs()" ng-class="{\n    active: tab.active\n  }" ng-bind-html="tab.content"></div>\n</div>'),n.put("typeahead/typeahead.tpl.html",'<ul class="f-dropdown" tabindex="-1">\n	<li ng-repeat="match in $matches track by $index">\n		<a href="" ng-click="$select($index)" ng-bind="match.label"></a>\n	</li>\n</ul>')}]);